import React from 'react';
import Pation from './Pation';
import Apointment from './Appointment';
import Drug from './Drug';
import './App.css';

function Navbar() {
  return (
<nav>
<h3>manager</h3>
<ul classname="nav-link">
<li>appointment</li>
<li>pation</li>
<li>drug</li>
</ul>
</nav>
  );
}

export default Navbar;
